import { utils } from 'demo-common';
import { workflowDemo } from '../api';
import wrappedDeclareActions from '../actions/apply.action';

const { unwrapActions } = utils;

const declareActions = unwrapActions(wrappedDeclareActions);

export default {
  namespace: 'apply',
  state: { catalog: {} },
  reducers: {
    fetchSuccess(state, { payload }) {
      return { ...state, ...payload };
    },
  },
  effects: {
    *fetch({ payload }, { call, put }) {
      try {
        const { data } = yield call(workflowDemo.declares_id_get, {
          params: { id: payload },
        });
        // 保存数据
        yield put(declareActions.fetchSuccess(data));
      } catch (e) {
        console.log(e);
      }
    },
  },
};
